import React from "react"
import Header from "./header"

export default function Home(props){
    return (
        <div className="container">
            <Header />
            <div className="content">         
                <a href="/books">Books</a><br />
                <a href="/cart">Cart</a><br /> 
            </div>       
        </div>
    )
}
